e";s:3:"8.0";s:13:"vod_score_all";i:7032;s:13:"vod_score_num";i:879;s:8:"vod_time";i:1566886790;s:12:"vod_time_add";i:1562998393;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:1582:"东汉末年，天下大乱、群雄纷争，魏、蜀、吴三国相继倔起，成鼎足之势，演出了一幕分久必合、合久必分的历史长剧。&nbsp<br />　　诸侯混战的结局形成了三股强大的势力：北方的曹操“挟天子以令诸侯”，先后歼灭袁绍、袁术等势力，统一了黄河流域，占据了中原地带；刘备三顾茅庐，得诸葛亮出山辅佐，又有关羽、张飞这样猛将追随，最后，经过“赤壁之战”，迫使曹操北还，得以占据益州与荆州等地，逐步发展壮大；江东孙氏自孙坚开始，就以江东六郡81郡为根据地站稳了脚跟，直至孙权，实力日益增强。&nbsp;<br />　　此后，三国争战层层展开。先是孙权乘关羽和曹兵交战之际，派兵偷袭荆州，关羽败走麦城，死于孙权之手。其后，孙权建立吴国。刘备亦继汉统，建立蜀汉。为报关羽被害之仇，刘备亲征江东，结果孤军深入，大败，刘备病死白帝城，托孤于诸葛亮。不久，曹操病死，其子曹丕废汉自立，定国号“魏”。&nbsp;<br />　　刘备死后，诸葛亮辅佐少主刘禅，独撑危局。其间，诸葛亮坚持联吴抗曹，七擒孟获之后，稳定了后方。又先后六出祁山伐魏，但均以失败告终，诸葛亮也积劳成疾，病死军中。他死后，姜维继其职，先后九伐中原，同样无功而返。后主刘禅昏庸无能，朝政腐败，蜀汉国力日渐衰弱。三国时代以刘禅亡和孙浩降而画上了句号。自此，三国归晋。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:4190:"第01集$http://shenling.dijiang-zuida.com/20180214/RGpXTUWU/index.m3u8#第02集$http://shenling.dijiang-zuida.com/20180214/xRMx7e8Q/index.m3u8#第03集$http://shenling.dijiang-zuida.com/20180214/x0M55K0T/index.m3u8#第04集$http://yushou.qitu-zuida.com/20180214/euPb83JD/index.m3u8#第05集$http://yushou.qitu-zuida.com/20180214/PdkBxW22/index.m3u8#第06集$http://yushou.qitu-zuida.com/20180214/XPk23cqd/index.m3u8#第07集$http://yushou.qitu-zuida.com/20180214/xqJP21eI/index.m3u8#第08集$http://shenling.dijiang-zuida.com/20180214/w0wnV69K/index.m3u8#第09集$http://shenling.dijiang-zuida.com/20180214/saWUaya5/index.m3u8#第10集$http://yushou.qitu-zuida.com/20180214/WhNS9uqJ/index.m3u8#第11集$http://yushou.qitu-zuida.com/20180214/KdETJvDl/index.m3u8#第12集$http://yushou.qitu-zuida.com/20180214/OMfp7YUv/index.m3u8#第13集$http://yus